(30, 'Banner - Oscar Hemopa', 'O Hemopa quer disponibilizar um banner da seguinte forma: \r\n\r\n"A ideia seria a de uma pessoa doando sangue e erguendo uma estatueta do Oscar, com a frase ''''E o Oscar de solidariedade vai para... O doador de sangue!''''."\r\n\r\n ', 1, '2016-02-24', '2016-02-26', NULL, NULL, NULL, 6, 21, 7, 1),
(31, 'Planejamento e Criação Textual ', '1 vídeo para a Fan Page - apenas postagem \r\n1 capa fan page governo\r\n1 capa fan page secom\r\n3 capas de grupos (secomnerd, secom e ascom)\r\n1 wallpaper\r\n1 capa twitter\r\n1 capa google +\r\n1 banner para instagram\r\n3 cartazes (servidor, aluno e professor)\r\n1 banner servidor\r\n6 banners de serviço', 3, '2016-02-16', '2016-02-17', NULL, 1, 15, 15, 18, 8, 0),
(32, 'Reunião de Brainstorm ', 'Reunir com todas as assessorias que desenvolvam algum trabalho relacionado ao tema para instituir uma campanha única.', 3, '2016-02-22', '2016-02-22', NULL, 1, 15, 15, 20, 8, 0),
(33, 'Vídeo Animação ', 'Desenvolver vídeo-animação com os passos a serem feitos para exterminar o Aedes Aegypti. ', 3, '2016-02-18', '2016-02-22', NULL, 1, 15, 15, 18, 13, 0),
(34, 'Divulgação da Campanha ', 'Divulgação da campanha nas redes sociais do Governo. \r\n\r\nProgramar posts no Facebook e demais redes.\r\n\r\nDivulgar nos grupos. ', 2, '2016-02-17', '2016-02-25', NULL, NULL, NULL, 15, 18, 8, 1),
(35, 'Briefing Aplicativo ', 'Escrever um briefing inicial das necessidades do aplicativo.', 3, '2016-02-19', '2016-02-22', NULL, NULL, NULL, 15, 7, 15, 1),
(36, 'Reunião de Brainstorm ', 'Marcar reunião com toda a equipe para brainstorm do aplicativo e definir principais necessidades.', 3, '2016-02-19', '2016-02-19', NULL, NULL, NULL, 15, 7, 15, 1),
(37, 'Planejamento e Criação Textual ', 'Produção dos banners para redes sociais: \r\n\r\n1 destaque especial\r\n4 Aspas\r\n3 banners - carrossel ', 2, '2016-02-22', '2016-02-22', NULL, 1, 15, 15, 19, 9, 0),
(38, 'Criação Gráfica', 'Criação gráfica dos materiais da campanha:\r\n\r\n1 Destaque Especial\r\n4 Aspas\r\n3 Banners Carrossel', 2, '2016-02-22', '2016-02-25', NULL, NULL, NULL, 15, 19, 7, 1);
